import React from 'react';
import {Link} from 'react-router-dom';

function Menu(){
    return  (
        <>
        <Link className='Menustyle' to='/user'>User</Link>
        <Link className='Menustyle' to='/'>About</Link>
        <Link className='Menustyle' to='/contact'>Contact</Link>
        <Link className='Menustyle' to='/service'>Service</Link>
        </>  
    )
}

export default Menu;
